import React from 'react';

const TopBar = () => {
  const handleGoBack = () => {
    window.location.href = '/'; // Redireciona para a rota raiz
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid d-flex justify-content-center align-items-center">
        <button className="btn btn-outline-secondary me-auto" onClick={handleGoBack}>Voltar</button>
        <span className="navbar-brand" style={{ marginLeft: 'auto', marginRight: 'auto' }}>Sua Empresa</span>
        <div className="collapse navbar-collapse" id="navbarNav">
          {/* Se você tiver links de navegação, adicione-os aqui */}
        </div>
      </div>
    </nav>
  );
};

export default TopBar;
